import './App.css';
import {   Header , Footer } from './Container/index'
import Cover from './Container/Cover/Cover';
import { useState } from 'react';
function App() {
  let [ thewords , setheword ] = useState([])
  let addthewords = (theword) => {
     setheword([theword , ...thewords  ])
  }
  return (
    <div className="App">
   <Header />
   <Cover 
    onSubmit={addthewords}
    />
   <Footer />
    </div>
  );
}

export default App;
